import axios from 'axios';

const apiClient = axios.create({
  baseURL: 'https://api.themoviedb.org/3',
  headers: {
    'Content-Type': 'application/json',
  },
  params: {
    api_key: '8a20b32ade4d94ec689e556b053961a3',
  },
});

export default apiClient;
